import React from "react";

const Card = () => {
  return (
    <div className="card">
      <h5>Card Title</h5>
      <p className="card-sub-text">
        ome quick example text to build on the card title and make up the bulk
        of the card's content.
      </p>
      <button type="button" className="card-button">
        Go somewhere
      </button>
    </div>
  );
};

export default Card;
